import React from "react";
import {
  ServicesContainer,
  ServicesH1,
  ServicesWrapper,
  ServicesCard,
  ServicesIcon,
  ServicesH2,
  ServicesP,
} from "../whySection/servicesElements";

import Icon1 from "../../images/svg-1.svg";

const Services = () => {
  return (
    <>
      <ServicesContainer id="services">
        <ServicesH1>BUT WHY WE DO IT?</ServicesH1>
        <ServicesWrapper>
          <ServicesCard>
            <ServicesIcon src={Icon1}></ServicesIcon>
            <ServicesH2>THIS IS H2</ServicesH2>
            <ServicesP>THIS IS P</ServicesP>
          </ServicesCard>
          <ServicesCard>
            <ServicesIcon></ServicesIcon>
            <ServicesH2></ServicesH2>
            <ServicesP></ServicesP>
          </ServicesCard>
          <ServicesCard>
            <ServicesIcon></ServicesIcon>
            <ServicesH2></ServicesH2>
            <ServicesP></ServicesP>
          </ServicesCard>
        </ServicesWrapper>
      </ServicesContainer>
    </>
  );
};

export default Services;
